import { useParams } from 'react-router-dom'
import Navbar from './navbar'
import { Container,Image } from 'react-bootstrap';
import image from '../../assets/images/australia.png'
// import Content from './content'
// import { CardContent } from './data'


function Details({data}){
    const params = useParams();
    // const data = CardContent() 
    return(
        <>
            <Navbar />
            {data.filter((list) => list.id == params.id).map((list) => (
            <Container className='p-5'>
                <div>
                    <h1 className='fw-semibold'>{list.tittle}</h1>
                    <span className='text-secondary'>{list.city}</span>
                </div>
                <div>
                    <Image src={image} alt='gambar'/>
                </div>
            </Container>
            ))}


        </>
    )
}

export default Details
